                <li>briananderson346@gmail.com</li>
                <li>cbheinbaugh@gmail.com</li>
                <li>saahilshangle@gmail.com</li>
                <li>spencerrcobb@gmail.com</li>
            </ul>
        </div>
      </div>
    );
  }
}

export default Contact;
